import { Avatar, Box, Card, CardHeader, Grid, IconButton } from "@material-ui/core";
import {red, indigo} from "@material-ui/core/colors"
import NavigationIcon from '@material-ui/icons/Navigation';

const projectList = [1];

function Projects() {
    return (
        <Box overflow='auto' p={3}>
            <Grid container>
                {projectList.map(item =>
                    <Grid item>
                        <Card sx={{width: 345}}>
                            <CardHeader
                                avatar={<Avatar sx={{bgcolor:red[500]}}>API</Avatar>}
                                title='API Weather APP' subheader='APIWeatherApp.feidorian.dev'
                                action={<IconButton><NavigationIcon sx={{color:indigo[900], fontSize:'2rem'}}/></IconButton>}>

                            </CardHeader>
                        </Card>
                    </Grid>
                    )}
            </Grid>
        </Box>
    )
};

export default Projects;
